package com.ctfs.WICI.TestCase;

import java.io.BufferedInputStream;
import java.io.ByteArrayInputStream;
import java.io.DataInputStream;
import java.io.FileOutputStream;
import java.util.ArrayList;
import java.util.Collection;

import org.apache.commons.codec.binary.Base64;
import org.junit.After;
import org.junit.Assert;
import org.junit.Before;
import org.junit.Test;

import com.ctfs.WICI.Helper.ImageUtils;

public class ImageUtilsTest
{
	private static final int _6KB = 6000;
	private ImageUtils sut;
	private Collection<String> dataUrls;

	private String oneOffImageString = "data:image/png;base64,";
	private String jasonImageString = "data:image/png;base64,";

	private String appSigEncodedOnceString = "";

	@Before
	public void initialize()
	{
		sut = new ImageUtils();
		dataUrls = new ArrayList<String>(10);
		dataUrls.add("data:image/png;base64,");
		dataUrls.add("data:image/png;base64,");
		dataUrls.add("data:image/png;base64,");
		dataUrls.add("data:image/png;base64,");
	}

	@After
	public void clearCollections()
	{
		dataUrls.clear();
	}

	@Test
	public void test_that_converted_image_is_base64encoded() throws Exception
	{
		for (String inputStrDataUrl : dataUrls)
		{
			byte[] convertedImageExpectedtoBeBase64Encoded = sut.convertPNGDataURLToJPGByteArray(inputStrDataUrl);
			Assert.assertTrue(Base64.isBase64(convertedImageExpectedtoBeBase64Encoded));
		}
	}

	@Test
	public void test_that_converted_image_is_in_jpeg_format() throws Exception
	{
		for (String inputStrDataUrl : dataUrls)
		{
			byte[] convertedImage = sut.convertPNGDataURLToJPGByteArray(inputStrDataUrl);
			byte[] decodedJPG = Base64.decodeBase64(convertedImage);

			ByteArrayInputStream byteArrayStreamForDecodedJPGImage = new ByteArrayInputStream(decodedJPG);
			DataInputStream jpegImageInputStream = new DataInputStream(new BufferedInputStream(byteArrayStreamForDecodedJPGImage));

			// This is the JPEG header
			Assert.assertTrue(jpegImageInputStream.readInt() == 0xffd8ffe0);

			jpegImageInputStream.close();
		}
	}

	@Test
	public void test_that_converted_image_is_less_than_6kb() throws Exception
	{
		for (String inputStrDataUrl : dataUrls)
		{
			byte[] convertedImage = sut.convertPNGDataURLToJPGByteArray(inputStrDataUrl);
			byte[] decodedJPG = Base64.decodeBase64(convertedImage);
			// Assert that size of output byte array is less than 6kB
			Assert.assertTrue(decodedJPG.length < _6KB);
		}
	}

	@Test
	public void test_that_we_can_export_converted_image_from_string_to_actual_file() throws Exception
	{

		byte[] byteArray = sut.convertPNGDataURLToJPGByteArray(this.oneOffImageString);

		String encodedJPGImageAsString = new String(byteArray);

		// System.out.println("oneOffImage=" + encodedJPGImageAsString);

		byte[] decodedJPG = Base64.decodeBase64(byteArray);

		FileOutputStream fos = new FileOutputStream("test/OneOffImage.jpg");
		fos.write(decodedJPG);
		fos.close();
	}

	@Test
	public void test_that_we_can_export_converted_image_from_jason_string_to_actual_file() throws Exception
	{

		byte[] byteArray = sut.convertPNGDataURLToJPGByteArray(this.jasonImageString);

		String encodedJPGImageAsString = new String(byteArray);

		// System.out.println("jasonImageString=" + encodedJPGImageAsString);

		byte[] decodedJPG = Base64.decodeBase64(byteArray);

		FileOutputStream fos = new FileOutputStream("test/jasonImageString.jpg");
		fos.write(decodedJPG);
		fos.close();
	}

	@Test
	public void test_that_we_can_export_base64_string_encoded_once_to_actual_file() throws Exception
	{

		byte[] decodedJPGImage = Base64.decodeBase64(this.appSigEncodedOnceString);

		// System.out.println("appSigEncodedOnceString=" + new
		// String(decodedJPGImage));

		FileOutputStream fos = new FileOutputStream("test/appSigEncodedOnce.jpg");
		fos.write(decodedJPGImage);
		fos.close();
	}

}
